function render_svg_vertical_options()
{
  $vertical_options = get_field('vertical_slider_options');
  foreach ($vertical_options as $vert_option) {
    echo '<p class="pb-2 font-bold text-white">' . $vert_option['text'] . '</p>';
  }
}
