    .marker {
      motion-path: var(--off-set-path);
      offset-path: var(--off-set-path);
      animation: var(--move-animation);
    }

    @keyframes move {
      100% {
        motion-offset: 50%;
        offset-distance: 50%;
      }
    }

    @keyframes secondary {

      /* first circle */
      0% {
        opacity: 1;
        transform: scale(1);
      }

      0.8% {
        opacity: 1;
        transform: scale(1);
      }

      1.3% {
        opacity: 0;
        transform: scale(.4);
      }

      3% {
        opacity: 0;
        transform: scale(.4);
      }

      5% {
        opacity: 1;
        transform: scale(1);
      }

      /* second circle */
      14% {
        opacity: 1;
        transform: scale(1);
      }

      14.6% {
        opacity: 0;
        transform: scale(.4);
      }

      16% {
        opacity: 0;
        transform: scale(.4);
      }

      16.6% {
        opacity: 1;
        transform: scale(1);
      }

      /* third circle */
      23% {
        opacity: 1;
        transform: scale(1);
      }

      24% {
        opacity: 0;
        transform: scale(.4);
      }

      26% {
        opacity: 0;
        transform: scale(.4);
      }

      28% {
        opacity: 1;
        transform: scale(1);
      }

      /* 4th circle */
      36.8% {
        opacity: 1;
        transform: scale(1);
      }

      37% {
        opacity: 0;
        transform: scale(.4);
      }

      40.6% {
        opacity: 0;
        transform: scale(.4);
      }

      41.4% {
        opacity: 1;
        transform: scale(1);
      }

      /* 5th circle */
      41.8% {
        opacity: 1;
        transform: scale(1);
      }

      41.93% {
        opacity: 0;
        transform: scale(.4);
      }

      45.53% {
        opacity: 0;
        transform: scale(.4);
      }

      46% {
        opacity: 1;
        transform: scale(1);
      }

      /* last step */
      89% {
        opacity: 1;
        transform: scale(1);
      }

      89.7% {
        opacity: 0;
        transform: scale(.4);
      }

      96.93% {
        opacity: 0;
        transform: scale(.4);
      }

      97.3% {
        opacity: 1;
        transform: scale(1);
      }
    }
